import React, { useContext, useState } from 'react'
import axios from '../Axios';
import { Link, useParams }  from "react-router-dom";
import UserContext from '../../context/UserContext';
export default function CommentForm() {
  let { id } = useParams();
  const userCtx = useContext(UserContext);
  const [loading, setLoading] = useState(null);
  const [userId, setUserId] = useState(null);
  const [searchNumber, setSearchNumber] = useState("dd");
  const [userName, setUserName] = useState({imageUrl:null, name:null});
  const [cate, setCate] = useState(null);
  const [cateId, setCateId] = useState(null);
  const [commnet, setComment] = useState(null);
  const [error, setError] = useState(null);
  const phoneSearch = (e) =>{
    if(e.target.value.length === 8){
      axios.get('users?select=_id lastName firstName profileImage&role=user&phone='+e.target.value,{
            headers:{Authorization:`Bearer ${userCtx.userState.token}`}
      }).then((result)=>{
        const resultData = result.data.data[0];
        if(resultData){
          setUserId(resultData._id); setUserName({imageUrl:resultData.profileImage, name:resultData.firstName+" "+resultData.lastName});
        }else{setUserId(null); setUserName({imageUrl:null, name:null}); setSearchNumber(e.target.value); console.log("dd")}
        console.log(resultData)
      }).catch((err)=>{console.log(err)})

      e.target.value="";
    }
  }
  return (
    <div className="content-wrapper">
      <div className="content-header">
        <div className="container-fluid">
          <div className="row mb-2">
            <div className="col-sm-10">
              <h1 className="m-0">Сэтгэгдэл {id ? "засах":"нэмэх"}</h1>
            </div>{/* /.col */}
            <div className="col-sm-2">
              <Link to={`../comment`}>
                <button type="button" className="btn btn-block btn-primary btn-sm">Буцах</button>
              </Link>
            </div>
          </div>{/* /.row */}
        </div>{/* /.container-fluid */}
      </div> 
      <div className="content">
        <div className="container-fluid">
          <div className="row">
            <div className="col-sm-2">
              <label htmlFor="Selectrole">Хэрэглэгч хайх</label>
              <input type="number" className={`form-control`} name="userId" max={8} placeholder="Утасны дугаар" defaultValue={userId} onChange={phoneSearch}/>
            </div>
            <div className="col-sm-2">
              <label htmlFor="Selectrole">Хэрэглэгч</label>
              {userId ?
                <div style={{display:'flex', flexDirection:'row'}}>
                  <div>zurag{userName.imageUrl}</div>
                  <div>:{userName.name}</div>
                </div>
               :<><div style={{color:'red'}}>{searchNumber}</div><div style={{color:'red'}}>Хэргэлэгч олдсонгүй</div></>
              }
              
            </div>

            <div className="col-sm-4">
              <label htmlFor="Selectrole">Төрөл</label>
              <select className="form-control" id="cateSelect" name="cate" defaultValue={cate} >
                <option value="">Сонгох</option><option value="1">Аялал</option><option value="2">Мэдээлэл</option><option value="3">Блог</option>
              </select>
            </div>
            <div className="col-sm-4">
              <label htmlFor="Selectrole">Төрөл</label>
              <select className="form-control" id="cateIdSelectss" name="cateId" defaultValue={cateId}>
                <option value="">Сонгох</option>
              </select>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}
